import base64
from PIL import Image
from io import BytesIO

# Tu hash de Base64 (sin incluir el prefijo 'data:image/jpeg;base64,')
base64_string = ""  # reemplaza los puntos con el hash sin el prefijo

# Decodifica el string de Base64
image_data = base64.b64decode(base64_string)

# Crea una imagen usando PIL
image = Image.open(BytesIO(image_data))

# Muestra la imagen
image.show()

# Guarda la imagen si lo deseas
image.save("imagen_generada.jpg")
